import React from "react";
import { Link } from "react-router-dom";
import "./profile.css";
import avatar from "./img/fin.jpg";
import Calculator from "./Calculator";
import XrpWallet from "./XrpWallet";

const Profile = () => {
  return (
    <div className="profile-page">
      <div className="profile-picture">
        <img src={avatar} alt="Profile" className="profile-img" />
      </div>
      <div className="dashboard">
        <h2 className="dashboard-title">Dashboard</h2>
        <div className="dashboard-options">
          <Link to="/calculate" className="dashboard-option">
            Calculate
          </Link>
          <Link to="/wallet" className="dashboard-option">
            Your Wallet
          </Link>
        </div>
      </div>
      {/* Add the Calculator and XrpWallet components here */}
      <Calculator />
      <XrpWallet />
    </div>
  );
};

export default Profile;
